import './css/Turtle.css';
import React from 'react';
import { Link } from 'react-router-dom';

function Where_Link(props) {
    return(
        <div className={props.className}>
            <Link to={props.to}><img src={props.src} className='Where_Link' alt={props.alt}></img></Link>
            <Link to={props.to}><p className='Where_Link_Text'>{props.text}</p></Link>
        </div>
    )
}

export default function Turtle() {
    return(
        <div>
            <div className='menu'>
                <p className='pageName'>거북이 수족관</p>
                <p className='logOut'>로그아웃</p>
                <div className='Turtle_Background'>
                    <Where_Link className='UnderTheSea_LinkContainer' to='/DeepSea' src='/UnderTheSea_Link.png' alt='DeepSea' text='심해' />
                    <Where_Link className='Space_LinkContainer' to='/Space' src='/Space_Link.png' alt='Space' text='우주' />
                </div>  
            </div>
        </div>
    )
}
